;[Macro Names]; h2incX scans the input stream looking for function prototypes. But what looks like
;a prototype may be a macro invocation instead. This could only be determined if a symbol table is
;maintained and *all* sources (including header files) would be scanned. h2incX doesn't do this and
;so this table may be needed. Any entries here will be known by h2incX as being macros, so it will
;not try to generate prototypes for them.
;h2incX maintains a macro symbol table. In conjunction with option -i most macros will be recognized
;without being included here.
;
;Meaning of values on the right side of "=":
;  MCF_KNOWN            001h => Known macro
;  MCF_HAS_PARAMS       002h => Macro has parameters
;  MCF_SKIP_BRACES      004h => Skip braces in macro call
;  MCF_COPY_LINE        008h => Assume rest of line belongs to macro call
;  MCF_PARAMS_FOLLOW    010h => Assume method parameters coming after macro
;  MCF_END_MACRO        020h => End next block with a ???_END macro call
;  MCF_STRUCT_BEG       040h => Macro begins a struct/union definition
;  MCF_INTERFACE_BEG    080h => Add an "??Interface equ <xxx>" line
;  MCF_INTERFACE_END    100h => Add an "??Interface equ <>" line
;  MCF_ARG_EXPRESSION   200h => Force argument handling as expression
;  MCF_SKIP_INVOKATION  400h => Skip macro invokation

